import React, { Component } from 'react';
import './App.css';
import Greet from './Greet.js';



function Garage() {
  return (
    <>
      <h1>Who lives in my Garage?</h1>
      <Greet />
    </>
  );
}


ReactDOM.render(<Garage />, document.getElementById('root'));
export default App;
